import React, { Component } from "react";
import { connect } from "react-redux";
import Button from "@material-ui/core/Button";

class StartBrewingPage extends Component {
  toLogBook = id => {
    this.props.history.push(`/logbook`); // brings the user to logbook
  };

  toCreateBatch = () => {
    this.props.history.push(`/create`); // brings the user to home
  };
  render() {
    return (
      <div>
        <Button onclick={this.toLogBook}>To Brew Log</Button>
        <p>HEY THIS IS THE HOME PAGE : START BREWING!</p>
        <Button onclick={this.toCreateBatch}>To Create Batch</Button>
        {/* <button
              className={props.className}
              onClick={() => props.dispatch({ type: "LOGOUT" })}
            >
              Log Out
            </button> */}
      </div>
    );
  }
};





const mapStateToProps = reduxStore => {
  return {
    reduxStore
  };
};

export default connect(mapStateToProps)(StartBrewingPage);
